import React from "react";

import {
	NavbarContainer,
	NavbarWrap,
	NavbarDireita,
	NavbarEsquerda,
	NavbarIcones,
} from "./NavbarElementos";

import { NotificationsNone } from "@material-ui/icons";

const Navbar = () => {
	return (
		<NavbarContainer>
			<NavbarWrap>
				<NavbarEsquerda>IMPERAtrading</NavbarEsquerda>
				<NavbarDireita>
					<NavbarIcones></NavbarIcones>
				</NavbarDireita>
			</NavbarWrap>
		</NavbarContainer>
	);
};

export default Navbar;
